import logo from './logo.svg';
import './App.css';
import UserLogin from './components/auth/UserLogin';
import HomePage from './components/HomePage/HomePage';
import { BrowserRouter, Routes, Route, Link, Navigate } from "react-router-dom";
import { AppBar,IconButton,Toolbar,Button,Typography,Box } from "@mui/material";
import authServices from './services/AuthServices';

import Products from './components/HomePage/Products';

function App() {
  return (
    <BrowserRouter>
      <Box sx={{ flexGrow: 1 }}>
        <AppBar position="static">
          <Toolbar>
            <Typography variant="h7"  sx={{ flexGrow: 1}}>

              <Link to="/" style={{color:"white",paddingRight:"1rem"}}>Home</Link>
              <Link to="/products" style={{color:"white",paddingRight:"1rem"}}>Products</Link>
              <Link to="/Login" style={{color:"white",paddingRight:"1rem"}}>Login</Link>          
              <Button variant="contained" color='primary' onClick={()=>{
                console.log(authServices.logOut());
                console.log(authServices.isLogged());
              }}>Logout</Button>
            </Typography>
          </Toolbar>
        </AppBar>
      </Box>
      <Routes>
        <Route path="/" element={ <HomePage /> } />
        <Route path="/products" element={<Products /> } />
        <Route path="/login" element={ <UserLogin /> } />
                {/* if no route will found new Page will comes  */}
      </Routes>
    </BrowserRouter>



  );
}

export default App;
